import data from "./data.js";

function Display({name, price, pictures, seller, location, rate}

    )
    {

    return (<div>

    <div>{name}</div>
    <div>{price}</div>
    <div>{pictures}</div>
    <div>{data[0].seller.name}</div>
      <div>{data[0].seller.firstName}</div> 
      <div>{data[0].seller.phoneNumber}</div> 
      <div>{data[0].seller.address}</div> 
      <div>{data[0].location.city}</div>
      <div>{data[0].location.country}</div> 
      <div>{data[0].location.street}</div> 
      <div>{data[0].location.zipCode}</div>
    <div>{rate}</div>

    </div>
    
    )
}


export default Display;
